const sdata = [
  {
    id: 1,
    imgsrc: 'https://picsum.photos/id/237/200/300',
    title: 'Jan',
    sname: 'First',
    link: 'https://www.netflix.com/in/',
  },
  {
    id: 2,
    imgsrc: 'https://picsum.photos/seed/picsum/200/300',
    title: 'Fab',
    sname: 'Second',
    link: 'https://www.netflix.com/in/',
  },
  {
    id: 3,
    imgsrc: 'https://picsum.photos/200/300?grayscale',
    title: 'March',
    sname: 'Third',
    link: 'https://www.netflix.com/in/',
  },
];

export default sdata;

// Hamne is file me React liabrary ko import isliye nahi kiya kyuki hame is page par JSX code ko likne ki jarurat nahi hai, React liabrary ko usi page par import karte hai jaha hame JSX likne ki jarurat ho.
